import React from 'react';
import './scss/Blog.scss'

export const Blog = () => {

    const likes = (key) => {
        let cnts = document.querySelectorAll('.like-count')

        for (let i = 0; i < cnts.length; i++) {
           if (cnts[i].value === "&#9825;") {
              key+=1 
           } else {
            key-=1 
           }
       }
       
       
        console.log(key)
        return key
       
       
       }

        
    


    return (
        <div className="all-posts-wrap">
            <div className="blog-item">block1</div>
            <div className="blog-item">block2</div>
            <div className="blog-item">block3</div>
            <div className="blog-item">block4</div>
            <div className="blog-item">block5</div>
            <div className="blog-item">block6
                <button className="like-count" value="&#9825;" onClick={likes(6)}>&#9825; 6</button>
            </div>
            
        </div>


        
    )
}
